\name{getTxParz}
\alias{getTxParz}
\title{Get the best-fit parameters for treatment}
\usage{
getTxParz(M, mort.parms, denominator = "cohort")
}
\arguments{
\item{M}{A 2xN matrix: the first column being observation times; the second column being cumulative fraction treated at each time in the cohort of those who are ultimately treated}

\item{mort.parms}{The best-fit Weibull shape and scale parameter for mortality as vector}

\item{denominator}{Whether fractions have the whole cohort as denominator (default: 'cohort') or only those ultimately 'exposed'}
}
\value{
A list with a logical flag to indicate convergence, and the best-fit Weibull shape and scale parameters.
}
\description{
For fitting to treatment data.
}
\details{
This takes data on cumulative percentiles of cumulative treatment among those treated, and fits a Weibull distribution to it so as to minimize the sum-of-squares error, taking into account the competing hazard of death.
}
\examples{
## some data:
mortality.times <- c(2,8,30)
mortality.fracs <- c(0.07, 0.14, 0.14)
treatment.times <- c(0.5, 30)
treatment.fracs <- c(0.19, 0.38)

## first fit mortality using Yfit:
mortality.parms <- Yfit(mortality.times, mortality.fracs)

## then fit treatment:
treatment.data <- cbind(treatment.times, treatment.fracs)
treatment.parms <- getTxParz(treatment.data, mortality.parms)

}
\author{
Pete Dodd
}

